//Don't touch below

//Convert Chart
for(var j = 0 ; j < height*width ;j++){
	if(convertChart[data[j]]) data[j] = convertChart[data[j]];
}

//Make 2D array
var str = '["';
for(var j = 0 ; j < height ;j++){
	for(var i = 0 ; i < width ; i++){
		str += data[i+width*j];
	}
	str += '","';
	//str += '",\n"';
}
str = str.slice(0,-2);
str += ']';
console.log(str);

//Zone
array = JSON.parse(str);
for(var y = 0 ; y < array.length ;y++){
	for(var x = 0 ; x < array[y].length ; x++){
		if(array[y][x] == 0) continue;
		var type = array[y][x];
		if(!zone[type]) zone[type] = {start:{x:x,y:y}};
		zone[type].end = {x:x,y:y};
	} 
}	
 
for(var i in zone){
	//1 length => 1 pts
	if(zone[i].start.x == zone[i].end.x &&	zone[i].start.y == zone[i].end.y){
		zone[i] = {x:zone[i].start.x,y:zone[i].start.y};
		continue;
	}
	//Zone
	zone[i] = [zone[i].start.x,zone[i].end.x,zone[i].start.y,zone[i].end.y];
}





